import logo from './logo.svg';
import './App.css';
import List from './components/list';
import Home from './components/home';
import About from './components/about';
import Nav from './components/nav';
import './bootstrap.css'
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div>
      <Nav></Nav>
      <h1> שלום לכולם </h1>
      {/* BrowserRouter-תגית שבתוכה יוכלו הקומפוננטות המתחלפות */}
      <BrowserRouter>
        <Routes>
          {/* Routes-תגית המכילה את כל תגיות הניתובים */}
          {/* <Route path="/שם שאני רוצה" element={שם הקומפוננטה}></Route> */}
          <Route path="/myabout" element={About}></Route>
          <Route path="myhome" element={Home}></Route>
          <Route path="/mylist" element={List}></Route>
        </Routes>
      </BrowserRouter>

    </div>

  );
}

export default App;
